import './Rating.css';

function Rating(props) {
  return (
    <>
        <div className="product-rating">
          <p>Rating: </p>
          <div className='rating-background'>
            <div className="star-rating">
                <span className="star">&#9733;</span>
                <span className="star">&#9733;</span>
                <span className="star">&#9733;</span>
                <span className="star">&#9733;</span>
                <span className="star">&#9733;</span>
            </div>
          </div>
          
          <p>{props.rating}/5</p>
        </div>
    </>
    
  );
}

export default Rating;
